parameters.inputSchema:
{
  "type": "object",
  "properties": {
    "invoiceDate": {
      "type": "string",
      "description": "Invoice date in format MM/DD/YY (e.g. 09/12/25)",
      "pattern": "^\\d{2}/\\d{2}/\\d{2}$"
    },
    "invoiceDate2": {
      "type": "string",
      "description": "Invoice date in format YYMMDD (e.g. 250912)",
      "pattern": "^\\d{6}$",
      "minLength": 6,
      "maxLength": 6
    },
    "bookingAccount": {
      "type": "number",
      "description": "Booking account code from the Google Sheet"
    },
    "totalAmount": {
      "type": "number",
      "description": "Total invoice amount"
    },
    "currency": {
      "type": "string",
      "description": "Invoice currency"
    },
    "invoiceNumber": {
      "type": "string",
      "description": "Invoice number"
    },
    "bookingText": {
      "type": "string",
      "description": "Description or booking text"
    },
    "vendor": {
      "type": "string",
      "description": "Vendor/Supplier name"
       },
    "folderID": {
      "type": "string",
      "description": "Google Drive Folder ID from the Google Sheet"
    }
  },
  "required": ["invoiceDate", "invoiceDate2", "konto", "vendor", "folderID"]
}
